import { Modal, Button } from "antd";
import React from "react";
import EditNoteForm from "../Form/EditNoteForm";

const ModalEdit = ({ visible, loading, closeModal, noteEdit, handleSubmitEdit }) => {
  return (
    <>
      <Modal
        visible={visible}
        title="Edit"
        // onOk={handleOk}
        onCancel={closeModal}
        footer={[
          <Button key="back" onClick={closeModal}>
            Return
          </Button>,
          <Button
            key="submit"
            type="primary"
            htmlType="submit"
            form="form"
            loading={loading}
            // onClick={handleOk}
          >
            Submit
          </Button>,
        ]}
      >
        <EditNoteForm handleSubmitEdit={handleSubmitEdit} noteEdit={noteEdit}/>
      </Modal>
    </>
  );
};

export default ModalEdit;
